//SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.7;

contract ChainFood {

    struct Food{
        uint id;
        address owner;
        string title;
        uint price;
        bool isSold;
        uint32 like;
        uint32 dislike;
    }

    event FoodCreated (uint indexed id, address indexed, string indexed, uint price, uint32 like, uint dislike);
    event Deleted(uint id);
    event Ordered(uint id, address indexed buyer, uint orderAmount);
    event Withdrawn(uint id, uint amount);
    event Liked(uint indexed id, uint32 likeAmount);
    event Disliked(uint indexed id, uint32 dislikeAmount);

    uint public id;

    mapping (uint => Food) public foods;
    mapping (uint => mapping(address => uint)) public orderTime;
    mapping (uint => mapping(address => bool)) public isOrdered;
    mapping (uint => mapping(address => uint)) public orderAmount;  
    mapping (uint => mapping(address => uint)) public likeAmount;
    mapping (uint => mapping(address => uint)) public dislikeAmount;

    function create(string memory _title, uint _price) external{
        id += 1;
        foods[id]=Food(id,msg.sender, _title, _price,false,0,0);

        emit FoodCreated(id,msg.sender,_title, _price,0,0);
    }

    function deleteFood (uint _id) external{
        Food memory food = foods[_id];
        require(food.owner == msg.sender, "You are not owner");
        require (!food.isSold, "Cant be deleted");
        delete foods[_id];

        emit Deleted(_id);
    }

    function orderFood(uint _id) payable external{
        Food storage food = foods[_id];
        require(food.id == _id, "Not exists");
        require(msg.value==food.price, "payment is insufficient");
        (bool success, ) = food.owner.call{value: msg.value}("");
        require(success, "Payment failed");
        food.isSold=true;
        isOrdered[_id][msg.sender] =true;
        orderTime[_id][msg.sender]=block.timestamp;
        orderAmount[_id][msg.sender] +=1;
        uint newOrderAmount = orderAmount[_id][msg.sender];

        emit Ordered(_id, msg.sender, newOrderAmount);
    }

    function like(uint _id) external{
        Food storage food = foods[_id];
        require(isOrdered[_id][msg.sender], "Should order before");
        require(orderTime[_id][msg.sender]+10 days > block.timestamp, "Evaluation process done");
        require(orderAmount[_id][msg.sender] > likeAmount[_id][msg.sender], "You liked it before");
        likeAmount[_id][msg.sender] +=1;
        food.like +=1;

        emit Liked(_id, food.like);
    }
    function dislike(uint _id) external{
        Food storage food = foods[_id];
        require(isOrdered[_id][msg.sender], "Should order before");
        require(orderTime[_id][msg.sender]+10 days >= block.timestamp, "Evaluation process done");
        require(orderAmount[_id][msg.sender] > dislikeAmount[_id][msg.sender], "You disliked it before");
        dislikeAmount[_id][msg.sender] +=1;
        food.dislike +=1;

        emit Disliked(_id, food.dislike);
    }

    function getLastGivenId() external view returns(uint){
        return id;
    }

}

